import axios from 'axios';
import {BrowserRouter, Route, Switch} from 'react-dom'

function App() {
  return (
    <BrowserRouter>
    <div className="container pt-4">
      <Switch>
        <Route/>
      </Switch>
    </div>
    </BrowserRouter>
  );
}

export default App;
